INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 1, 1, 2, 24001, 40011, "リリ", 0, 125801);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 1, 2, 24001, 40011, "クリア", 0, 126001);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (323, "んーと。\nこれ、あげる。\nはい", 1, 3, 1, 2, 24001, 40011, "プレシア", 0, 126101);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 4, 2, 2, 24001, 40011, "リリ", 0, 125801);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 5, 2, 2, 24001, 40011, "クリア", 0, 126001);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (326, "お兄。\nきてくれて、うれしい", 1, 6, 2, 2, 24001, 40011, "プレシア", 0, 126101);
